import { DataSource } from 'typeorm';

const tableName = 'workspace';

export const SeedWorkspaceId = '20202020-1c25-4d02-bf25-6aeccf7ea419';

export const seedWorkspaces = async (
  workspaceDataSource: DataSource,
  schemaName: string,
  workspaceId: string,
) => {
  await workspaceDataSource
    .createQueryBuilder()
    .insert()
    .into(`${schemaName}.${tableName}`, [
      'id',
      'displayName',
      'domainName',
      'inviteHash',
      'logo',
      'subscriptionStatus',
    ])
    .orIgnore()
    .values([
      {
        id: workspaceId,
        displayName: 'تابا',
        domainName: 'tabatelecom.ir',
        inviteHash: 'tabatelecom.ir-invite-hash',
        logo: 'data:image/png;base64,',
        subscriptionStatus: 'incomplete',
      },
    ])
    .execute();
};

export const deleteWorkspaces = async (
  workspaceDataSource: DataSource,
  schemaName: string,
  workspaceId: string,
) => {
  await workspaceDataSource
    .createQueryBuilder()
    .delete()
    .from(`${schemaName}.${tableName}`)
    .where(`${tableName}."id" = :id`, { id: workspaceId })
    .execute();
};
